import React, {Component} from 'react'

class Entryitem extends Component{
    render() {
        return(
            <>
               <div className="entry-item">
                   <div className="entry-item-img"></div>
                   <div className="entry-item-name"></div>
               </div>
            </>
        );
    }
}
export default Entryitem
